import { useState } from 'react';
import { BrowserRouter as Router, Route }from 'react-router-dom';

function Contato() {
  return (
    <Router>
      <div>
        <Route path='/contact' component={Contato}>
         <div id='Principais'>
            <div className='contato'>
              Studio DaCapo <num> 67 99191-9080 </num> 
              Alysson (somente WPP) <num> 11 95885-0243 </num>
              Diego <num> 67 99969-3300 </num>
              Luciano <num> 67 99904-4358 </num>
            </div>
          </div>
        </Route>
      </div>
    </Router>
  );
}

export default Contato;
